import React, {useState} from "react";
import { useParams } from "react-router-dom";
import "./StockDetails.css";
import {
  MDBTabs,
  MDBTabsItem,
  MDBTabsLink,
  MDBTabsContent,
  MDBTabsPane,
} from "mdb-react-ui-kit";

function StockDetailsComponent() {
  const { id } = useParams();

  const [fillActive, setFillActive] = useState('tab1');

//   const handleFillClick = (value: string) => {
//     if (value === fillActive) {
//       return;
//     }

//     setFillActive(value);
//   };

  return (
    <div className="container resultPage">
      <div className="row">
        <div className="col leftCol">
          <div className="container companyData">
            <div className="row">
              <div className="col">
                <h1>
                  {/* {id} */}
                  Ticker ID
                </h1>
              </div>
              <div className="col">
                <h5>
                  {/* {id} */}
                  fav_btn
                </h5>
              </div>
            </div>

            <div className="row">
              <h3>
                {/* {id} */}
                Company Name
              </h3>
            </div>

            <div className="row">
              <h5>
                {/* {id} */}
                Stock Index
              </h5>
            </div>
          </div>
        </div>

        <div className="col rightCol">
          <div className="container stockValues">
            <div className="row justify-content-end">
              <h1>
                {/* {id} */}
                Stock Value
              </h1>
            </div>
            <div className="row justify-content-end">
              <h3>
                {/* {id} */}
                Stock Points
              </h3>
            </div>
            <div className="row justify-content-end">
              <h6>
                {/* {id} */}
                Time Stamp
              </h6>
            </div>
          </div>
        </div>
      </div>

      <div className="row">
        <MDBTabs fill className="mb-3">
          <MDBTabsItem>
            <MDBTabsLink
              onClick={() => handleFillClick("tab1")}
              active={fillActive === "tab1"}
            >
              Link
            </MDBTabsLink>
          </MDBTabsItem>
          <MDBTabsItem>
            <MDBTabsLink
              onClick={() => handleFillClick("tab2")}
              active={fillActive === "tab2"}
            >
              Very very very very long link
            </MDBTabsLink>
          </MDBTabsItem>
          <MDBTabsItem>
            <MDBTabsLink
              onClick={() => handleFillClick("tab3")}
              active={fillActive === "tab3"}
            >
              Another link
            </MDBTabsLink>
          </MDBTabsItem>
        </MDBTabs>

        <MDBTabsContent>
          <MDBTabsPane show={fillActive === "tab1"}>Tab 1 content</MDBTabsPane>
          <MDBTabsPane show={fillActive === "tab2"}>Tab 2 content</MDBTabsPane>
          <MDBTabsPane show={fillActive === "tab3"}>Tab 3 content</MDBTabsPane>
        </MDBTabsContent>
      </div>
    </div>
  );
}

export default StockDetailsComponent;
